    {"_id":"1000","_rev":"5-cd13e87a90b8c9a30d15aab8289bee96","blurb":"Sais-tu que les nuages sont nommés d’après leur forme, leur hauteur dans le ciel et le fait qu’ils produisent, ou ne produisent pas, des précipitations ?\r\nEn différents endroits, à des jours différents, quand tu observes le ciel, tu peux voir différents types de nuages. Nous allons commencer par apprendre les noms de\r\nces nuages et tu pourras les reconnaître lors de tes promenades. Dans cette brochure, nous utiliserons les mots que nous connaissons déjà, pour nous aider à apprendre les noms des différents types de nuages.","thumbnail_590_url":"images/1000/thumbnail.jpg","editor":[{"id":1,"name":"Library For All"}],"authors":[{"full_name":"Becca Hatheway","id":315},{"full_name":"Kerry Zarlengo","id":316},{"full_name":"Peggy LeMone","id":317},{"full_name":"Lisa Gardiner","id":318}],"name":"Sais-tu que les nuages ont un nom? ","tags":["NATURE","GRADES-6-8","GRADES-3-5"],"subjects":["LAB-SCIENCES"],"languages":["FR"],"countries":"CD,HT,RW","total_pages":34}
